import React from 'react';
import { Typography, Card, CardContent } from '@mui/material';

function Projects() {
  const projectList = [
    { title: "Portfolio Website", description: "Built with React and GSAP animations." },
    { title: "E-commerce App", description: "Fullstack app with Node.js backend." },
  ];

  return (
    <div style={{ marginTop: '2rem', display: 'flex', alignItems: 'center' }}>
      <Typography variant="h3" gutterBottom>Projects</Typography>
      {projectList.map((project, index) => (
        <Card key={index} sx={{ marginBottom: 2 }}>
          <CardContent>
            <Typography variant="h5">{project.title}</Typography>
            <Typography>{project.description}</Typography>
          </CardContent>
        </Card>
      ))}
    </div>
  );
}

export default Projects;
